import React from 'react';

const Header = () => {
  return (
    <header className="bg-gray-900 text-white py-4">
      <nav className="container mx-auto flex justify-between items-center">
        <h1 className="text-xl font-bold">IndiePage</h1>
        <ul className="flex">
          <li><a href="#features" className="text-white hover:text-gray-400 mr-4">Features</a></li>
          <li><a href="#pricing" className="text-white hover:text-gray-400 mr-4">Pricing</a></li>
          <li><a href="#contact" className="text-white hover:text-gray-400">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
